Finland / Denemarken / Ierland / Duitsland
Animatie / Familie
75 minuten

een mooie film

met de stemmen van Tommi Korpela, Juha Veijonen en Vesa Vierikko

Een klein rendierjongetje, genaamd Niko, droomt ervan om net zo te vliegen als zijn vader die hij nog nooit ontmoet heeft. 
Ondanks dat hij last heeft van hoogtevrees en duizeligheid, gaat hij er toch op uit om vlieglessen te krijgen van Julius, een 
Finse vliegende eekhoorn.
